<script>
export default {
    name: 'Knowledge',
    data () {
        return {
            input: '姑娘,你真是条汉子',
            input2: '姑娘,你真是条汉子'
        }
    },
    computed: {},
    mounted: function () {
        var dBox = document.getElementById('dBox')
        var dDrop = document.getElementById('dDrop')
        // 鼠标在box中头部按下的时候 计算鼠标在盒子中的坐标
        // 给头部注册鼠标按下的事件
        var getPage = function (ev) {
            return ev || window.event;
            return ev.target || ev.srcElement /* IE和Chrome下是srcElement FF下是target */
        }
        dDrop.onmousedown = function (e) {
            e = e || event;
            // 计算鼠标在盒子中的坐标=鼠标在页面中的坐标-盒子在页面中的坐标
            var x = getPage(e).clientX - dBox.offsetLeft
            var y = getPage(e).clientY - dBox.offsetTop
            // 鼠标在整个页面移动的过程中,计算盒子在页面中的坐标位置
            document.onmousemove = function (e) {
                // 计算盒子在页面中的坐标=鼠标在页面上的坐标-鼠标在盒子上的坐标
                var boxX = getPage(e).clientX - x
                var boxY = getPage(e).clientY - y
                // 不让这个盒子的头部出了body 不然出去就回不来了
                // console.log(boxX, boxY)
                if (boxX >= 0 && boxY >= 0) {
                    dBox.style.left = boxX + 'px'
                    dBox.style.top = boxY + 'px'
                }
            }
        }
        dDrop.onmouseup = function (e) {
            document.onmousemove = function () {}
        }
    },
    methods: {
    }
}
</script>
